import { Line, Chart } from 'react-chartjs-2';
import React, { useState } from 'react';


function Map() {
    const coordinates = [
      { lat: 42.39674, long: -71.12181 },
      { lat: 42.3884, long: -71.119149 }
    ]

    const config = {
      labels: ['A', 'B', 'C', 'D'],
        // datasets is an array of objects where each object represents a set of data to display corresponding to the labels above. for brevity, we'll keep it at one object
        datasets:[{
            data: [{x:0,y:1},{x:1,y:10},{x:9,y:5},{x:24,y:7}],
            backgroundColor: "rgb(10, 99, 132)",
                  borderColor: "#00843D", // Change line color to red

          },
        ],
      }
      const options = {
  scales: {
    x: {
      display: false, // Remove x-axis
      grid: {
        display: false // Remove x-axis grid lines
      }
    },
    y: {
      display: false, // Remove x-axis
      grid: {
        display: false // Remove y-axis grid lines
      }
    }
  },
  elements: {
      line: {
        borderWidth: 10 // Increase line width to 2 pixels
      }
    }
};
      return (
        <div className="Map">
          <Line data={config} options={options} />
        </div> 
      );
}

export default Map;
